import React from "react";
import { Dropdown, DropdownButton } from "react-bootstrap";

const LoginStatusDropdown = () => {
  return (
    <DropdownButton id="login-status-dropdown" title="Admin logged in" variant="secondary">
      <Dropdown.Item href="#/not-logged-in">Not logged in</Dropdown.Item>
      <Dropdown.Item href="#/user-logged-in">User logged in</Dropdown.Item>
      <Dropdown.Item href="#/admin-logged-in">Admin logged in</Dropdown.Item>
    </DropdownButton>
  );
};

export default LoginStatusDropdown;
